<script> // Iterates through images
	$(function () { // Preload Function
	  var stuff = ['Images/bg.jpg', 
	  							'Images/bg2.jpg', 
	  							'Images/bg3.jpg', 
	  							'Images/bg4.jpg', 
	  							'Images/bg5.jpg', 
	  							'Images/bg6.jpg', 
	  							'Images/bg7.jpg', 
	  							'Images/bg8.jpg', 
	  							'Images/bg9.jpg'];
	      counter = 0;

	  console.log(stuff[counter]); // your initial value

	  // the next line, of course, assumes you have an element with id="next"
	  $('#main svg').click(function () {
	      counter = (counter + 1) % stuff.length; // increment your counter
	      // the modulus (%) operator resets the counter to 0
	      // when it reaches the length of the array

	      console.log(stuff[counter]); // the new incremented value
	      $('#bg').attr("src", stuff[counter]);
	  });
	});
</script>

<script> // Fullize Image
	$(window).load(function() {    
		var theWindow        = $(window),
		    $bg              = $("#bg"),
		    aspectRatio      = $bg.width() / $bg.height();
		function resizeBg() {
			if ( (theWindow.width() / theWindow.height()) < aspectRatio ) {
			    $bg
			    	.removeClass()
			    	.addClass('bgheight');
			} else {
			    $bg
			    	.removeClass()
			    	.addClass('bgwidth');
			}
		}          			
		theWindow.resize(resizeBg).trigger("resize");
	});
</script>
